import React, {Component} from "react";
import logo from '../images/foresightLogo.svg'
import '../css/NavBar.css'
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

class NavBar extends Component{
    render(){

        const jsScript = ()=>{
            console.log('working!')
            var btnContainer = document.getElementById("navigation");
            var btns = btnContainer.getElementsByClassName("nav-links");
            for (var i = 0; i < btns.length; i++) {
                btns[i].addEventListener("click", function() {
                    var current = btnContainer.getElementsByClassName("active");
                    for(var j = 0; i < current.length; j++){
                        current[j].className = current[0].className.replace(" active", "");
                    }
                    this.className += " active";
                });
            }
        }
        return(
            <nav class="navbar navbar-expand-md  d-flex" id="top-navigation">
                <div className="navbar-header" style={{'width':'100%'}}>
                    <img className="navbar-brand" src={logo} href="#" id='foresightLogo'></img>
                    <button id="toggle-btn" class="navbar-toggler btn btn-default" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <i class="navbar-toggler-icon glyphicon glyphicon-align-justify text-light"></i>
                        {/* <span class="navbar-toggler-icon glyphicon gyphicon-chevron-right text-dark"></span> */}
                    </button>
                </div>
                <div class="collapse navbar-collapse text-center" id="navbarNav">
                    <ul class="navbar-nav navbar-right" id="navigation" style={{'margin':'auto'}}>
                        <li class="nav-item active">
                            <a class="nav-link" href="#" id="nav-lnks"><b>Home</b><span class="sr-only">(current)</span></a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#tHead" id="nav-lnks"><b>How To Play</b></a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#gs" id="nav-lnks"><b>Blogs</b></a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#" id="nav-lnks"><b>About</b></a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#" id="nav-lnks"><b>Contact</b></a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link m-0 pt-2" href="#"><button className="btn btn-default btn-download"><b>Download App</b></button></a>
                        </li>
                    </ul>
                </div>
                
            </nav>
        );
    }
}

export default NavBar
